  true,\n\t\"url\": null,\n\t\"notes\": \"EIA's State Energy Data System (SEDS) is
  a comprehensive data set that consists of annual time series estimates of state-level
  energy use by major economic sectors, energy production and and State-level energy
  price and expenditure data. The system provides data back from 1960. Data are presented
  in physical units, BTUs, and dollars. While some SEDS data series come directly
  from surveys conducted by EIA, many are estimated using other available information.
  These estimations are necessary for the compilation of \"total energy\" estimates.\",\n\t\"license_title\":
